export const stateDefinitions = {
    available: {
        color: 'transparent',
        label: 'Beschikbaar',
    },
    unavailable: {
        selectable: false,
        color: '#595959',
        label: 'Volzet',
    }
};

export const onSelect = (value, states) => {
    setValue( value, states );
    setAankomstt(value.start.format('DD-MM-YYYY'))
    setVertrekk(value.end.format('DD-MM-YYYY'))
    return value, aankomst, vertrek;
};
